import React from 'react';
import {AppBar, Typography} from '@mui/material'
import MedicalServicesIcon from '@mui/icons-material/MedicalServices';

const Header = () => {
  return (
    <React.Fragment>
       <AppBar>
        <MedicalServicesIcon/>
    <Typography>
        Welcome to Med/Pharma
    </Typography>
       </AppBar>
    </React.Fragment>
  )
}

export default Header
